  `update_time` datetime(0) NULL DEFAULT NULL COMMENT 'update time',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1790 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '告警表' ROW_FORMAT = Compact;

